import React from 'react';

export default function RemoveCustomFields({
    customFields,
    removeCustomFieldsFromFormState,
}) {
    return (
        <fieldset className='tile'>
            <legend>
                <b>Remove custom fields from the form.</b>
            </legend>
            <ul>
                {customFields.map((f) => (
                    <li>
                        <span>f.desc</span>
                        <btn className='btn btn--grey'>&times;</btn>
                    </li>
                ))}
            </ul>

            <button className='btn btn--grey'>Remove</button>
        </fieldset>
    );
}
